import { performance } from 'node:perf_hooks';

export default function loadBalancer(chinaDownload, USDownload) {
  const chinaStart = performance.now();
  chinaDownload();
  const chinaEnd = performance.now();
  const chinaTime = chinaEnd - chinaStart;
  const USStart = performance.now();
  USDownload();
  const USEnd = performance.now();
  const USTime = USEnd - USStart;
  return USTime > chinaTime ? USTime : chinaTime;
}

